import React from 'react';
import styled from 'styled-components';
import wrapperBackground from '../../assets/container.png';

const Home = () => {

    const Wrapper = styled.div`
        background-image: url(${wrapperBackground});
        background-size: cover;
        background-repeat: no-repeat;
        position: relative;
        height: 100vh;
        width: 100vw;
        display: flex;
        align-items: center;
    `;

    const Title = styled.h1`
        font-size: 50px;
        color: #ffffff;
        text-transform: uppercase;
        text-align: center;
        margin: auto;
    `;

    return(
        <Wrapper>
            <Title>Mateusz Bacherycz</Title>
            <br />
            <h3>Web Developer</h3>
        </Wrapper>
    );

};

export default Home;
